import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 2.2-4367 Purpose.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-4367.md","filePath":"vacode/2.2-4367.md"}'),o={name:"vacode/2.2-4367.md"},n=r('<h1 id="§-2-2-4367-purpose" tabindex="-1">§ 2.2-4367 Purpose. <a class="header-anchor" href="#§-2-2-4367-purpose" aria-label="Permalink to &quot;§ 2.2-4367 Purpose.&quot;">​</a></h1><p>The provisions of this article supplement, but shall not supersede, other provisions of law including, but not limited to, the State and Local Government Conflict of Interests Act (§ <a href="http://law.lis.virginia.gov/vacode/2.2-3100/" target="_blank" rel="noreferrer">2.2-3100</a> et seq.), the Virginia Governmental Frauds Act (§ <a href="http://law.lis.virginia.gov/vacode/18.2-498.1/" target="_blank" rel="noreferrer">18.2-498.1</a> et seq.), and Articles 2 (§ <a href="http://law.lis.virginia.gov/vacode/18.2-438/" target="_blank" rel="noreferrer">18.2-438</a> et seq.) and 3 (§ <a href="http://law.lis.virginia.gov/vacode/18.2-446/" target="_blank" rel="noreferrer">18.2-446</a> et seq.) of Chapter 10 of Title 18.2.</p><p>The provisions of this article shall apply notwithstanding the fact that the conduct described may not constitute a violation of the State and Local Government Conflict of Interests Act.</p><p>1982, c. 647, § 11-72; 1987, Sp. Sess., c. 1; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>.</p>',4),i=[n];function s(l,c,p,h,d,_){return t(),a("div",null,i)}const g=e(o,[["render",s]]);export{v as __pageData,g as default};
